import { func } from "prop-types";
import {useState, useEffect} from "react";



function Hello(){
  return <h1>Hello !</h1>
}


function App() {
  const [showing, setShowing] = useState(false);

  const onClick = () => setShowing(prev => !prev);

  return(
    <div>
      {showing ? Hello() : ""}
      <button onClick={onClick}>{showing ? "Hide" : "Show"}</button>
    </div>
  );
}

export default App;
